,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'  l_ctx    apex_exec.t_context;',
'  l_export apex_data_export.t_export;',
'BEGIN',
'  -- otwieramy kontekst zapytania',
'  l_ctx := apex_exec.open_query_context(',
'             p_location  => apex_exec.c_location_local_db,',
'             p_sql_query => q''[',
'               SELECT t.id        AS task_id,',
'                      t.name      AS task_name,',
'                      t.status_id AS task_status,',
'                      t.description,',
'                      t.priority_id AS priority,',
'                      t.employee_id',
'               FROM task t',
'               JOIN project_tasks pt ON pt.task_id = t.id',
'               WHERE pt.project_id = :P11_ID',
'             ]'' );',
'',
unistr('  -- eksport: przekazujemy r\00F3wnie\017C nazw\0119 pliku tutaj (bez rozszerzenia)'),
'  l_export := apex_data_export.export(',
'                p_context   => l_ctx,',
'                p_format    => apex_data_export.c_format_csv,',
'                p_file_name => ''Tasks_'' || :P11_ID,',
'                p_page_header => ''N''',
'              );',
'',
'  -- zamykamy kontekst',
'  apex_exec.close(l_ctx);',
'',
'  -- pobieramy plik: DOWNLOAD przyjmuje tylko p_export (i opcjonalne flags)',
'  apex_data_export.download( p_export => l_export );',
'',
'EXCEPTION',
'  WHEN OTHERS THEN',
unistr('    -- upewnij si\0119, \017Ce kontekst zostanie zamkni\0119ty przy b\0142\0119dzie'),
'    BEGIN',
'      IF l_ctx IS NOT NULL THEN',
'        apex_exec.close(l_ctx);',
'      END IF;',
'    EXCEPTION WHEN OTHERS THEN NULL;',
'    END;',
'    RAISE;',
'END;',
''))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_imp.id(87075395226013024724)
,p_internal_uid=>87075395580952024727
);
