,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'-- DECLARE',
'-- v_id NUMBER;',
'-- v_RoleList apex_application_global.vc_arr2 := APEX_UTIL.STRING_TO_TABLE(:P19_ROLE);',
'-- BEGIN',
'-- PKG_USER.del_user_role(p_user_id => :P19_ID);',
'',
'-- for l in 1..v_RoleList.count',
'-- loop',
'--     PKG_USER.ins_user_role(',
'--         p_user_id => :P19_ID,',
'--         p_role_id => v_RoleList(l));',
'-- end loop;',
'-- END;',
'',
'',
'DECLARE',
'  v_employee_id  USERS.EMPLOYEE_ID%TYPE;',
'  v_name         USERS.FULL_NAME%TYPE;',
'  v_login        USERS.LOGIN%TYPE;',
'  v_password     USERS.PASSWORD%TYPE;',
'  v_email        USERS.EMAIL%TYPE;',
'  v_RoleList     apex_application_global.vc_arr2 := APEX_UTIL.STRING_TO_TABLE(:P19_ROLE);',
'BEGIN',
unistr('  -- usu\0144 dotychczasowe role'),
'  PKG_USER.del_user_role(p_user_id => :P19_ID);',
'',
'  -- dodaj nowe role',
'  FOR l IN 1..v_RoleList.count LOOP',
'    PKG_USER.ins_user_role(',
'      p_user_id => :P19_ID,',
'      p_role_id => v_RoleList(l));',
'  END LOOP;',
'',
unistr('  -- pobierz dane u\017Cytkownika (bez warunku na employee_id)'),
'  BEGIN',
'    SELECT employee_id, full_name, login, password, email',
'    INTO v_employee_id, v_name, v_login, v_password, v_email',
'    FROM USERS',
'    WHERE id = :P19_ID;',
'  EXCEPTION',
'    WHEN NO_DATA_FOUND THEN',
'      v_employee_id := NULL;',
'      v_name := NULL;',
'      v_login := NULL;',
'      v_password := NULL;',
'      v_email := NULL;',
'  END;',
'',
unistr('  -- je\017Celi employee_id jest NULL, wykonaj update'),
'  IF v_employee_id IS NULL THEN',
'    UPDATE_USER(',
'      p_id          => :P19_ID,',
'      p_name        => v_name,',
'      p_login       => v_login,',
'      p_password    => v_password,',
'      p_email       => v_email,',
unistr('      p_employee_id => :P19_EMPLOYEE  -- tutaj musi by\0107 warto\015B\0107, kt\00F3r\0105 chcesz zapisa\0107'),
'    );',
'  END IF;',
'END;',
'',
''))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_imp.id(86353135446356087660)
,p_internal_uid=>86353395176228778756
);
