,p_process_sequence=>10
,p_process_point=>'BEFORE_HEADER'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'FetchUserRole'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'declare',
'  v_RoleList apex_application_global.vc_arr2;',
'i number:=1;',
'begin',
'  for l in (select r.id as id ',
'                from roles r',
'                join user_role ur',
'                on r.id = ur.role_id',
'                where ur.user_id=:P19_ID)',
'    loop',
'      v_RoleList(i):=l.id;',
'      i:=i+1;',
'    end loop;',
'',
'  :P19_ROLE := APEX_UTIL.TABLE_TO_STRING(v_RoleList,'':'');',
'end;'))
,p_process_clob_language=>'PLSQL'
,p_internal_uid=>86335399645608396820
);
