'BEGIN',
unistr('    -- Iterujemy po wierszach zwr\00F3conych przez parser'),
'    FOR r IN (',
'        SELECT col001, col002, col003, col004 -- status zawsze ustawiony na pending (1)',
'        FROM apex_application_temp_files f,',
'             apex_data_parser.parse(',
