'                 p_add_headers_row => ''Y'',',
'                 p_store_profile_to_collection => ''FILE_PARSES_COLLECTION'',',
'                 p_file_name => f.filename',
'             ) P',
'        WHERE f.name = :P30_FILE',
'          AND line_number >= 2',
'    ) LOOP',
'        -- Wstawiamy pojedynczy task i od razu pobieramy jego ID',
'        INSERT INTO TASK (NAME, DESCRIPTION, PRIORITY_ID, EMPLOYEE_ID,STATUS_ID)',
'        VALUES (r.col001, r.col002, r.col003, r.col004, 1)',
'        RETURNING ID INTO v_task_id;',
'',
'        -- Przypisujemy do projektu',
'        INSERT INTO PROJECT_TASKS (PROJECT_ID, TASK_ID)',
'        VALUES (v_project_id, v_task_id);',
'    END LOOP;',
'',
'    COMMIT;',
'END;',
'',
'',
'-- DECLARE',
'-- TYPE t_task_ids IS TABLE OF TASK.ID%TYPE;',
'-- v_task_ids t_task_ids;',
'',
'-- v_project_id NUMBER := :P30_PROJECTID;',
'--     BEGIN',
'--         INSERT INTO TASK',
'--         (NAME,',
'--         STATUS_ID,',
'--         DESCRIPTION,',
'--         PRIORITY_ID,',
'--         EMPLOYEE_ID',
'--         )',
'--             (SELECT col001, col002, col003, col004, col005',
'--                 FROM apex_application_temp_files f,',
'--                 apex_data_parser.parse(',
'--                     p_content => f.blob_content,',
'--                     p_add_headers_row => ''Y'',',
'--                     p_store_profile_to_collection => ''FILE_PARSES_COLLECTION'',',
'--                     p_file_name => f.filename',
'--                 ) P ',
'--                 where f.name = :P30_FILE and line_number >= 2',
'--             );',
'',
'--     END;'))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
